$(document).ready(function() {
	var el = $('textarea')[0];
	var editor = $('textarea').data('blockEditor');
	var canvas = editor.canvas;
	canvas.debug = true;
	el.innerHTML = frag15;
	editor.refresh();
	var N = 50;
	var total = [0,0,0];

	for (var i = 0; i < N; i++) {
		var r = canvas.redraw();
		total[0] += r[0];
		total[1] += r[1];
		total[2] += r[2];
	}

	total[0] /= N; // create grid
	total[1] /= N; // find and render
	total[2] /= N; // rendraw
	console.log(total[0]);
	console.log(total[1]);
	console.log(total[2]);
});
